/**
 * Get all available icons
 */
export function getAvailableIcons(): RegistryIconMetadata[] {
	return ICON_REGISTRY.filter(icon => icon.status === 'available');
}

/**
 * Get icons by category
 */
export function getIconsByCategory(categoryId: string): RegistryIconMetadata[] {
	return getAvailableIcons().filter(icon => icon.category === categoryId);
}

/**
 * Get all categories with counts
 */
export function getCategoriesWithCounts(): Category[] {
	const categoryMap = new Map<string, number>();
	const categoryLabels: Record<string, string> = {
		all: 'All Icons',
		users: 'Users & People',
		arrows: 'Arrows & Direction',
		communication: 'Communication',
		finance: 'Finance & Currency',
		brands: 'Brands & Social',
		status: 'Status & Loading',
		files: 'Files & Documents',
		commerce: 'Commerce & Shopping',
		security: 'Security & Privacy',
		navigation: 'Navigation & UI',
		general: 'General & Utility'
	};
	
	getAvailableIcons().forEach(icon => {
		categoryMap.set(icon.category, (categoryMap.get(icon.category) || 0) + 1);
	});
	
	const categories: Category[] = [
		{ id: 'all', label: 'All Icons', count: getAvailableIcons().length }
	];
	
	Array.from(categoryMap.entries())
		.sort(([, a], [, b]) => b - a) // Count'a göre sırala
		.forEach(([categoryId, count]) => {
			categories.push({
				id: categoryId,
				label: categoryLabels[categoryId] || categoryId,
				count
			});
		});
	
	return categories;
}

/**
 * Get total icon count
 */
export function getTotalIconCount(): number {
	return getAvailableIcons().length;
}

/**
 * Search icons by name, keywords, or description
 */
export function searchIcons(query: string, categoryId?: string): RegistryIconMetadata[] {
	let icons = getAvailableIcons();
	
	// Filter by category first
	if (categoryId && categoryId !== 'all') {
		icons = icons.filter(icon => icon.category === categoryId);
	}
	
	// Then filter by search query
	if (!query.trim()) return icons;
	
	const searchTerm = query.toLowerCase().trim();
	
	return icons.filter(icon => {
		return (
			icon.name.toLowerCase().includes(searchTerm) ||
			icon.description.toLowerCase().includes(searchTerm) ||
			icon.keywords.some(keyword => keyword.toLowerCase().includes(searchTerm))
		);
	});
}
